import ItemDetailContainer from './components/ItemDetailContainer/ItemDetailContainer';
import { BrowserRouter } from 'react-router-dom';



function App() {
  return (
    <>
    <></>
    <NavBar/>
    <ItemListContainer/>
    <ItemDetailContainer />
    <Cart />
    </>

  );
}
export default App;
